import React from "react";

function TaskList({ selectedCategory, category }) {
  return (
    <div>
      {selectedCategory.map((task, index) => (
        <div key={index}>
          <div className="checkbox"></div>
          <p>{task}</p>
        </div>
      ))}
    </div>
  );
}

export default TaskList;
